var ngModule=angular.module("footer.html",[]);ngModule.run(["$templateCache",function(e){e.put("footer.html",'<footer ng-controller="FooterCtrl as footer">\n	<div class="container">\n		<div class="row">\n			<div class="col-md-4">\n				<span class="copyright">Copyright © <a href="http://universless.com/" target="_blank">UNIVERSLESS Ltd.</a> 2015-2018\n					(<a href="https://github.com/nicroto/viktor/blob/master/LICENSE-MIT" target="_blank">MIT License</a>)</span>\n			</div>\n			<div class="col-md-4">\n				<ul class="list-inline social-links">\n					<li><a href="https://github.com/nicroto/viktor" target="_blank"><i class="fa fa-github"></i></a>\n					</li>\n					<li><a href="https://twitter.com/NikolayTsenkov" target="_blank"><i class="fa fa-twitter"></i></a>\n					</li>\n				</ul>\n			</div>\n			<div class="col-md-4">\n				<ul class="list-inline quicklinks">\n					<li>\n						<a ng-click="footer.openAboutModal()">About</a>\n					</li>\n					<li>\n						<a ng-click="footer.openPrivacyPolicyModal()">Privacy Policy</a>\n					</li>\n				</ul>\n			</div>\n		</div>\n	</div>\n\n	<script type="text/ng-template" id="privacyPolicyModal.html">\n		<div class="modal-header">\n			<button type="button" class="close" ng-click="footerModal.close()"><span>&times;</span></button>\n			<h4 class="modal-title">Privacy Policy</h4>\n		</div>\n		<div class="modal-body">\n			<h3>The information you provide to us</h3>\n			<p>This website, does not collect any personal information other than what is described in the next section "Tracking and cookies".</p>\n\n			<h3>Tracking and cookies</h3>\n			<p>To help us understand how we can make the website better, we use Google Analytics.</p>\n\n			<p>The data is anonymous and does not provide us with identifiable information.</p>\n\n			<hr style="width:60%">\n			<i>\n				<p>By using the website http://nicroto.github.com/vitkor/ owned by Nikolay Tsenkov, you agree to the Privacy Policy above.</p>\n\n				<p>If you have any questions about this privacy policy, please contact nikolay@tsenkov.net.</p>\n			</i>\n		</div>\n		<div class="modal-footer">\n			<div class="text-center">\n				<button type="button" class="viktor btn btn-primary"\n					ng-click="footerModal.close()">OK</button>\n			</div>\n		</div>\n	</script>\n\n	<script type="text/ng-template" id="aboutModal.html">\n		<div class="modal-header">\n			<button type="button" class="close" ng-click="footerModal.close()"><span>&times;</span></button>\n			<h4 class="modal-title">About</h4>\n		</div>\n		<div class="modal-body">\n			<h3>What is it?</h3>\n			<p>Viktor NV-1 is a software synthesizer.</p>\n			<h3>How does it work?</h3>\n			<p>It\'s Built on-top of the Web Audio API (WAA). The WAA is very nicely organized and easy to use. Basically it provides a variety of NodeTypes (responsible for sound generation, editing or analysis) which you combine in your liking, creating a graph through which your sound is being shaped.</p>\n			<p>Viktor produces sound in a pathway of oscillators and noise generators (as raw source of sound and timbre), envelopes (this one is a bit trickier to explain, you should research it), Low Pass filters and effects (Delay and Reverb).</p>\n			<p>This combines the 2 major ways of creating sound electronically - Additive (oscillators and noise) and Subtractive Sound Synthesis.</p>\n			<p>Viktor also makes use of the emerging Web MIDI API (just landed without a flag in Chrome 43). So you can play using your MIDI keyboard - plug it in, turn it on and restart the browser (not just the tab) and it should work.</p>\n			<h3>What browsers are supported?</h3>\n			<p>Sound-wise: Latest and gratest of Chrome and Safari. Firefox is not yet supported.</p>\n			<p>Mobile (iOS and Android) Chrome and Safari sound great, but there needs to be an optimized rendering, which isn\'t in-place, yet.</p>\n			<p>Midi: only desktop Chrome.</p>\n			<h3>Can I save my own patches/presets?</h3>\n			<p>Yes. The top row of the synth (with the green display in the middle) is called Patch Library. You can save your patches (they are not stored on the server - I use localStorage to persist your settings).</p>\n			<p>Even if you accidentally refresh the page, the settings should be intact. To backup the presets you have built - Export them (on Safari copy the text and save it to a file with extension .json, everywhere else it will let you download the file).</p>\n			<p>To get them on another computer or get someone else\'s library - simply use the import button.</p>\n			<h3>How do I share patches? Just files?</h3>\n			<p>You can share a full library of patches in a single file. Still, I acknowledge the fact this isn\'t the most convinient of ways. That\'s why I\'ve added sharing patches through url! On the right-hand side of the PatchLibrary display, look for a button with the popular share icon <i class="fa fa-2x fa-share-alt"></i>.</p>\n			<h3>What technologies did you use?</h3>\n			<p>Web Audio API, Web MIDI API, Local Storage (through npm module "store"). For the effects section I used Tuna.js.</p>\n			<p>AngularJS, webaudio-controls (I am regretting this decision, since these controls are full of bugs and had to fix several of them before releasing), Bootstrap, Font Awesome, Font Orbitron and Stylus is what I used for the UI.</p>\n			<p>Instead of using Angular alone, for dependency management, I use Browserify, which provides the nice CommonJS format/style of module creation and requiring.</p>\n			<p>Angular isn\'t very Browserify-friendly so I had to do some stitching in my initial setup (browserify-shim, browserify-ng-html2js etc.) but once the setup was ready development really felt a breeze.</p>\n			<p>Grunt and multiple grunt-contrib-\'s are used for the build (and development rebuild).</p>\n			<p>I drew the images on Pixelmator.</p>\n			<h3>So how can I get the code? It\'s all minified... :(</h3>\n			<p>This is only for performance/load-time reasons. Viktor is completely open-source and is licensed under the MIT license.</p>\n			<p>Fork <a target="_blank" href="https://github.com/nicroto/viktor/">the repo</a> and go NUTS! :)</p>\n			<h3>Why would you build this?</h3>\n			<p>I love Music. :)</p>\n			<p>Ever since I got into using virtual instruments, I wanted to take a peek into the world of Digital Signal Processing, but it always seemed so far off reach - I had to learn C++, get a dozen books on DSP etc.</p>\n			<p>Last year, in April, I heard about Beep.js and it caught my attention. I started experimenting, read and watched everything I could find on Synthesizers and started building what later became Viktor.</p>\n			<p>My primary source of inspiration was the Minimoog. And since I have never owned a synth, nor have I seen or played a Minimoog I got the user manuals and electronics schematics and started reading what connects to what, what are the ranges of different values and so on and here we are. :)</p>\n			<p>The NV-1 was my first project in audio and since then, I\'ve learned C++, DSP and even successfully started my own audio company.</p>\n			<h3>So, who are you?</h3>\n			<p>My name is Nikolay Tsenkov. I am a Software Engineer and the founder of <a href="http://universless.com">UNIVERSLESS</a> - a comapany specializing in Cross-Platform Audio Software Development.</p>\n			<p>You can follow me on <a target="_blank" href="https://twitter.com/nikolaytsenkov">Twitter</a>.</p>\n			<p>If you have an interesting audio project and you need a developer to build it - <a href="http://universless.com/contact/">contact us</a>, we might be able to help.</p>\n		</div>\n		<div class="modal-footer">\n			<div class="text-center">\n				<button type="button" class="viktor btn btn-primary"\n					ng-click="footerModal.close()">OK</button>\n			</div>\n		</div>\n	</script>\n</footer>')}]),module.exports=ngModule;
